import './App.css';
import Navbar from './components/Navbar';
import Section from './components/Section';
import GetStarted from './components/GetStarted';
import PreBuiltFeatures from './components/PreBuiltFeatures';
import JourneyStart from './components/JourneyStarts';
import Platform from './components/Platform';

function App() {
  return (
    <>
    <Navbar/>
    <Section/>
    <GetStarted/>
    <PreBuiltFeatures/>
    <JourneyStart/>
    <Platform/>
    </>

  );
}

export default App;
